import React, { Component } from 'react';
import './Homepage.css';

class Homepage extends Component {
    render() {
        return (
            <div>
                <h2>FUN - SPORT WEBSITE</h2>
                <div className='homepage-link'>
                    <a href="#">Sign up</a>
                    <a href="#">Log in</a>
                    <a href="#">Guest</a>
                </div>
                <div>
                    <img src='https://i2.wp.com/www.broadbandtvnews.com/wp-content/uploads/2017/01/logo-nba.jpg?fit=600%2C400&ssl=1&w=640'></img>
                    <img src=''>ufc logo</img>
                    <img src=''>ufc logo</img>

                </div>

            </div>
        );
    }
}

export default Homepage;
